column8:
弊社は楽天市場店の他に店頭や雑誌広告でも通信販売を行っており、<br>
タイミングによっては商品が欠品になっている可能性もあります。<br>
購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。汎用ノーブランド スポーツシートタイプ4（BS-04）を取り付けできる、<br>
ジムニーJB23 33 43の運転席用シートマウントです。<br>
車検適合は確約できませんのでご了承ください。<br>
受注生産品につき、納期が1～2週間必要です。<br>
助手席用や他型式のジムニー用も同価格で設定可能です。<br>
ご注文時にお知らせください。  

<br>送料区分 ： 120<!-- ここから リア受 -->
